// const int MAXN = 2e4+10;
     
class Solution {
public:
    unordered_map<int,int> fa,sz;
    int getfa(int val){
        if(fa[val] != val) fa[val] = getfa(fa[val]);
        return fa[val];
    }
    void unionfa(int v1, int v2){
        if(not fa.count(v2)) return;
        int f1 = getfa(v1), f2 = getfa(v2);
        // if(f1 > f2) swap(f1, f2);
        fa[f2] = f1; 
    }  
    vector<int> groupStrings(vector<string>& words) {
        int len = words.size();
        for(auto &word : words){
            int x = 0;
            for(auto &ch : word) x |= (1 << (ch - 'a'));
            sz[x]++;
            fa[x] = x;
        }
        for(auto &[x, _] : fa){
            int y;
            for(int i = 0; i < 26; i++){
                if(((x >> i) & 1)){
                    //delete
                    unionfa(x, x ^ (1 << i));
                    //alter
                    for(int j = 0; j < 26; j++) if(((x >> j) & 1) == 0) unionfa(x,x ^ (1 << i) | (1 << j)); 
                }else{
                    if(((x >> i) & 1) == 0) unionfa(x,x | (1 << i));
                }

            }
        }
        
        unordered_map<int,int> mp;
        int maxx = 0;
        for(auto &it : fa){
            int cfa = getfa(it.first);
            mp[cfa] += sz[it.first];
        }
        // cout << words.size() << endl; 
        // cout << fa.size() << endl;
        // for(auto &[x,y] : mp) cout << x << " " << y << endl;
        for(auto &it : mp) maxx = max(maxx, it.second);
            // cout << maxx << " " <<  mp.size();
        return {(int)mp.size(), maxx};        
    }
};
